import React from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const Logout = () => {
  const navigate = useNavigate();

  const handleLogout = async () => {
    try {
      const response = await axios.post('http://localhost:5000/api/logout', {}, { withCredentials: true });

      console.log('Logout response:', response.data); // Log the responseA

      if (response.data.success) {
        // Clear localStorage
        localStorage.removeItem('role');
        localStorage.removeItem('user');

        // Redirect to login page
        navigate('/');
      } else {
        console.error('Logout failed:', response.data.message); // Log the error
      }
    } catch (error) {
      console.error('Logout error:', error); // Log the error
    }
  };

  const styles = {
    card: {
      width: '300px',
      margin: '100px auto',
      padding: '20px',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
      borderRadius: '8px',
      backgroundColor: '#f9f9f9',
      textAlign: 'center',
    },
    title: {
      marginBottom: '20px',
      fontSize: '18px',
      fontWeight: 'bold',
      color: '#333',
    },
    buttonContainer: {
      display: 'flex',
      justifyContent: 'space-between',
      marginTop: '20px',
    },
    logoutButton: {
      backgroundColor: '#ff4d4d',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      padding: '10px 20px',
      cursor: 'pointer',
      fontWeight: 'bold',
      transition: 'background-color 0.3s',
    },
    cancelButton: {
      backgroundColor: '#ccc',
      color: '#333',
      border: 'none',
      borderRadius: '4px',
      padding: '10px 20px',
      cursor: 'pointer',
      fontWeight: 'bold',
      transition: 'background-color 0.3s',
    },
  };

  return (
    <div style={styles.card}>
      <h3 style={styles.title}>Are you sure you want to logout?</h3>
      <div style={styles.buttonContainer}>
        <button
          onClick={handleLogout}
          style={styles.logoutButton}
          onMouseOver={(e) => (e.target.style.backgroundColor = '#e04a4a')}
          onMouseOut={(e) => (e.target.style.backgroundColor = '#ff4d4d')}
        >
          Yes, Logout
        </button>
        <button
          onClick={() => navigate('/')}
          style={styles.cancelButton}
          onMouseOver={(e) => (e.target.style.backgroundColor = '#b3b3b3')}
          onMouseOut={(e) => (e.target.style.backgroundColor = '#ccc')}
        >
          Cancel
        </button>
      </div>
    </div>
  );
};

export default Logout;
